    function getQueryParam(name) {
      const params = new URLSearchParams(location.search);
      return params.get(name);
    }

    const nopolQuery = (getQueryParam('nopol') || '').toUpperCase().replace(/\s+/g,'');
    document.getElementById('title').textContent = `Hasil: ${nopolQuery}`;

    const container = document.getElementById('content');

    function tampilkanData() {
      if (!nopolQuery) {
        container.innerHTML = `<div class='notfound'>Masukkan parameter ?nopol= di URL</div>`;
        return;
      }
      const headers = Object.keys(dataKendaraan[0] || {});
      const kolomNopol = headers.find(h => h.toLowerCase().includes('nopol') || h.toLowerCase().includes('no')) || headers[0];

      const hasil = dataKendaraan.filter(row =>
        (row[kolomNopol] || '').toString().toUpperCase().replace(/\s+/g,'') === nopolQuery
      );

      if (hasil.length === 0) {
        container.innerHTML = `<div class='notfound'>Mohon Ma'af NOPOL "${nopolQuery}" tidak Terdaftar Member.</div>`;
        return;
      }

      let html = '';
      hasil.forEach(row => {
        html += `<h3>Data Kendaraan Member</h3><table>`;
        for (const [key, val] of Object.entries(row)) {
          html += `<tr><th>${key}</th><td>${val}</td></tr>`;
        }
        html += `</table><br/>`;
      });

      container.innerHTML = html;
    }

    tampilkanData();
  </script>
